func isomorphic(s, t string) bool {
	a := []rune(s)
	b := []rune(t)
	if len(a) != len(b) {
		return false
	}

	h := make(map[rune]rune)
	g := make(map[rune]rune)
	p := make(map[rune]int)
	q := make(map[rune]int)
	for i := range a {
		x, y := a[i], b[i]
		if h[x] == 0 {
			h[x] = y
		}
		if g[y] == 0 {
			g[y] = x
		}
		p[x]++
		q[y]++
		if p[x] != q[y] || h[x] != y || g[y] != x {
			return false
		}
	}
	return true
}
